INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 4, 0.0, "2030/12/17 14:59:59", 10021, 110501, 0.0, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 24, 24015);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 1, 0.0, "2030/12/17 14:59:59", 10021, 110501, 4.0, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4, 24, 24016);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 4, 0.0, "2030/12/17 14:59:59", 10021, 110501, 0.0, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 24, 24017);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 0.0, "2030/12/17 14:59:59", 10021, 110501, 5.2, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 1, 24, 24018);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 6, 0.0, "2030/12/17 14:59:59", 10021, 110501, 4.2, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 24, 24019);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 0.0, "2030/12/17 14:59:59", 10021, 110501, 0.0, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 24, 24020);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 6, 0.0, "2030/12/17 14:59:59", 10021, 110501, 6.4, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 1, 24, 24021);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 0.0, "2030/12/17 14:59:59", 10021, 110501, 0.0, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 24, 24022);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 3, 0.0, "2030/12/17 14:59:59", 10021, 110501, 10.08, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 6, 24, 24023);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 0.0, "2030/12/17 14:59:59", 10021, 110501, 5.0, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 1, 24, 24024);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 2, 0.0, "2030/12/17 14:59:59", 10021, 110501, 0.0, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 24, 24025);
